import React from "react";
import Nv from "./topnav";
import prof from "./profile.png";
import Ham from "./ham";
import { useLocation } from "react-router-dom";

const Profile = () => {
    const locc = useLocation();
    return (
    <div>
         {window.innerWidth < 450 ? <Ham userid={locc.state.userid} uuid={locc.state.uuid} /> 
         : 
         <Nv userid={locc.state.userid} uuid={locc.state.uuid}/>}
        <div>
            <div className="inline-block w-fitp-[40px] rounded-md bg-[#e6e9f0]">
                <img src={prof} className="m-auto h-[150px]"/>
                <h1 className="m-[5px] whitespace-nowrap font-bold">Ojas Sharma</h1>
                <h6 className="font-medium">Aspiring devoloper</h6>
            </div>
            <div className="inline-block text-[200px] bg-[#e6e9f0] rounded-md">
                Very big content
            </div>
            <div>

            </div>
        </div>
    </div>
    );
}

export default Profile;
